body:
['
', '\item Given parallelogram $SNOW$ with $S(2,1),N(7,1),O(10,5),W(5,5)$}
', '    \begin{enumerate}
', '      \item Sketch $SNOW$, labeling the vertices.\\
', '        \begin{tikzpicture}[scale=.635]
', '          \draw [help lines] (-2,-1) grid (12,7);
', '          \draw [thick, ->] (-2.2,0) -- (12.4,0) node [below right] {$x$};
', '          \draw [thick, ->] (0,-1.2)--(0,7.4) node [left] {$y$};
', '        \end{tikzpicture}
', '      \item Find the area of the parallelogram.\vspace{3cm}
', '      \item Find the length of each side of the parallelogram.\vspace{5cm}
', '      \item Find the slopes of the diagonals, $\overline{SO}$ and $\overline{NW}$.\vspace{3.5cm}
', '      \item Are the diagonals parallel, perpendicular, or neither? Justify your answer.
', '  \end{enumerate}
', '
', '\end{enumerate}
']

problems_list:
['Given parallelogram $SNOW$ with $S(2,1),N(7,1),O(10,5),W(5,5)$}
    \begin{enumerate}
      \item Sketch $SNOW$, labeling the vertices.\\
        \begin{tikzpicture}[scale=.635]
          \draw [help lines] (-2,-1) grid (12,7);
          \draw [thick, ->] (-2.2,0) -- (12.4,0) node [below right] {$x$};
          \draw [thick, ->] (0,-1.2)--(0,7.4) node [left] {$y$};
        \end{tikzpicture}
      \item Find the area of the parallelogram.\vspace{3cm}
      \item Find the length of each side of the parallelogram.\vspace{5cm}
      \item Find the slopes of the diagonals, $\overline{SO}$ and $\overline{NW}$.\vspace{3.5cm}
      \item Are the diagonals parallel, perpendicular, or neither? Justify your answer.
  \end{enumerate}

']

body:
['
', '\item Given polygon $HEXAGN$ with $S(2,1),N(7,1),O(10,5),W(5,5)$ and circumscribed circle $P(,)$}
', '    \begin{enumerate}
', '      \item Draw the polygon $HEXAGN$, labeling the vertices.\\
', '        \begin{tikzpicture}[scale=.635]
', '          \draw [help lines] (-2,-1) grid (12,7);
', '          \draw [thick, ->] (-2.2,0) -- (12.4,0) node [below right] {$x$};
', '          \draw [thick, ->] (0,-1.2)--(0,7.4) node [left] {$y$};
', '        \end{tikzpicture}
', '      \item Draw the two diagonals, $\overline{SO}$ and $\overline{NW}$, using dashed lines. Find the slope of these two diagonals, showing the calculation. \vspace{3.5cm}
', '      \item Are the two diagonals parallel, perpendicular, or neither? Justify your answer.\vspace{3.5cm}
', '      \item Spicy: What type of triangle is $XPA$? Justify your answer.
', '  \end{enumerate}
', '
', '\end{enumerate}
']

problems_list:
['Given polygon $HEXAGN$ with $S(2,1),N(7,1),O(10,5),W(5,5)$ and circumscribed circle $P(,)$}
    \begin{enumerate}
      \item Draw the polygon $HEXAGN$, labeling the vertices.\\
        \begin{tikzpicture}[scale=.635]
          \draw [help lines] (-2,-1) grid (12,7);
          \draw [thick, ->] (-2.2,0) -- (12.4,0) node [below right] {$x$};
          \draw [thick, ->] (0,-1.2)--(0,7.4) node [left] {$y$};
        \end{tikzpicture}
      \item Draw the two diagonals, $\overline{SO}$ and $\overline{NW}$, using dashed lines. Find the slope of these two diagonals, showing the calculation. \vspace{3.5cm}
      \item Are the two diagonals parallel, perpendicular, or neither? Justify your answer.\vspace{3.5cm}
      \item Spicy: What type of triangle is $XPA$? Justify your answer.
  \end{enumerate}

']

